const getRandomInt = (min: number, max: number) => {
  min = Math.ceil(min);
  max = Math.floor(max);
  return Math.floor(Math.random() * (max - min + 1) + min); // The maximum is inclusive and the minimum is inclusive
};

export const getMockRandomPhotos = () => {
  const idx = getRandomInt(0, mockRandomPhotosList.length - 1);

  return mockRandomPhotosList[idx];
};

export const getMockSearchPhotos = (page: number) => {
  return mockSearchPhotosList[page - 1];
};

export const getMockDetailPhoto = () => {
  const idx = getRandomInt(0, mockDetailPhotoList.length - 1);
  return mockDetailPhotoList[idx];
};
